.equ TIMER_BASE, 0xff202000 
.equ AUDIO_BASE, 0xff203040
.equ PS2_BASE, 0xFF200100
.equ SDRAM,      0x04000000
.equ FRAME_W_H, 80
.equ VIDEO_LIMIT, 768000
.equ WIDTH, 320
.equ HEIGHT, 240  
.equ XCENTER, 120
.equ YCENTER, 80              
.equ LOG2_BYTES_PER_ROW, 10
.equ LOG2_BYTES_PER_PIXEL, 1
.equ PIXBUF, 0x08000000

.section .exceptions, "ax"
START_ISR:
    /*save registers*/
    subi sp, sp, 8
	stw r2, 0(sp)
	stw r3, 4(sp)	
ISR_COND:
    /*check if interrupt is from PS2*/
    rdctl r3, ipending
	andi r3, r3, 0b10000000
	beq r3, zero, ISR_VIDEO
PS2_ISR:
    /*read PS2 data*/
	movia r2, PS2_BASE
	ldwio r2, 0(r2)
	andi r2, r2, 0xFF
COND_1:
    /*Verifing initial break code*/
	movi r3, 0xE0
	bne r2, r3, COND_2
	mov r10, r2
	movi r11, 0
	movi r12, 0
	br END_ISR
	
COND_2:
    /*Verifing second break code*/
	bne r3, r10, END_ISR
	movi r3, 0xF0
	bne r3, r2, COND_3
	mov r11, r2
	movi r12, 0
	br END_ISR
COND_3:
    /*If first and second codes happend, then, get arrows code*/
	movi r3, 0xE0
	bne r10, r3, CLEAN
	movi r3, 0xF0
	bne r11, r3, CLEAN
	movi r10, 0
	movi r11, 0
	mov r12, r2
    movi r13, 0x75              # 75 is the code for up arrow
	beq r12, r13, up_arrow
	movi r13, 0x72              # 72 is the code for down arrow
	beq r12, r13, down_arrow
	br END_ISR
up_arrow:
	addi r9, r9, 1              # incrementing volume
	br END_ISR
	
down_arrow:
	subi r9, r9, 1              # decrementing volume
    br END_ISR
CLEAN:
	movi r10, 0
	movi r11, 0
	movi r12, 0
    br END_ISR
ISR_VIDEO:
    rdctl r3, ipending
    andi r3, r3, 0b1
    beq r3, zero, END_ISR
FRAME:
    /*save registers to memory*/
    subi sp,sp,48
    stw r3,0(sp)
    stw r4,4(sp)
    stw r5,8(sp)
    stw r6,12(sp)
    stw r7,16(sp)
    stw r8,20(sp)
    stw r16,24(sp)
    stw r17,28(sp)
    stw r20,32(sp)
    stw r21,36(sp)
    stw ra,40(sp)
    stw ea,44(sp)

    movia r3, TIMER_BASE
    sthio r0, 0(r3) # reset timer to
    /*print frame*/
    movia r21, VIDEO_LIMIT
    movia r20, FRAME_W_H
    bltu r23,r21,cond
    movi r23,0 # reset video counter
    mov r5,r8  # reset audio counter
    cond:
		movi r17, 0
		loop1:
			movi r16, 0
			loop2:
				mov r4, r16
                addi r4, r4, XCENTER
				mov r5, r17
                addi r5, r5, YCENTER
				ldw r6, VIDEO(r23)
				call WritePixel		# Draw one pixel
				addi r23, r23, 4	
				addi r16, r16, 1
				blt r16, r20, loop2
			addi r17, r17, 1
			blt r17, r20, loop1	

    /*restore registers from memory*/
    ldw r3,0(sp)
    ldw r4,4(sp)
    ldw r5,8(sp)
    ldw r6,12(sp)
    ldw r7,16(sp)
    ldw r8,20(sp)
    ldw r16,24(sp)
    ldw r17,28(sp)
    ldw r20,32(sp)
    ldw r21,36(sp)
    ldw ra,40(sp)
    ldw ea,44(sp)
    addi sp, sp, 48
END_ISR:
    /*restore registers*/
	ldw r2, 0(sp)
	ldw r3, 4(sp)
	addi sp, sp, 8

    subi ea, ea,4
    eret

# r4: col (x)
# r5: row (y)
# r6: colour value
WritePixel:
	movi r7, LOG2_BYTES_PER_ROW		# log2(bytes per row)
    movi r8, LOG2_BYTES_PER_PIXEL	# log2(bytes per pixel)
    
    sll r5, r5, r7
    sll r4, r4, r8
    add r5, r5, r4
    movia r4, PIXBUF
    add r5, r5, r4
	sthio r6, (r5)		# Write 16-bit pixel
	ret

.text
.global _start
_start:
    /* set up the stack */
    movia sp, SDRAM
    /* registers for video*/
    movi r23, 0             # video words counter
    /* registers for audio*/
    movia r6, 0xff203040	# Audio device base address: DE1-SoC
    movi r8, 32000			# word number times 4 = 8000x4
    movi r9,12
    mov r5, r8
    /*set timer conf*/
	movia	r16, TIMER_BASE
	movia	r12, 3333333		# 1/(100 MHz) x (1/30 x 10^8) = 33,333ms
	sthio	r12, 8(r16)			# store the low half word of counter start value
	srli	r12, r12, 16
	sthio	r12, 0xC(r16)		# high half word of counter start value
	/* start interval timer, enable its interrupts */
	movi	r15, 0b0111			# START = 1, CONT = 1, ITO = 1
    sthio	r15, 4(r16)
    /* enable keyboard interrupts */
    movia r14, PS2_BASE
    movi r15, 0b1
    sthio r15, 4(r14)
    /*Enable IRQ 0*/
    rdctl r2, ienable
    ori r2,r2,0b10000001
    wrctl ienable, r2
    /*Enable PIE bit*/
    rdctl r2,status
    ori r2,r2,0b1
    wrctl status, r2
WaitForAudio:
    /* wating for audio buffer space */
    ldwio r2, 4(r6) 
    andhi r3, r2, 0xff00
    beq r3, r0, WaitForAudio
    andhi r3, r2, 0xff
    beq r3, r0, WaitForAudio   
WriteTwoSamples:
    /* play audio samples  */
	ldw r4, AUDIO(r5)
	sll r4, r4, r9
    stwio r4, 8(r6)
    stwio r4, 12(r6)
    subi r5, r5, 4
    bne r5, r0, WaitForAudio
RestartAudio:
    /* restart audio counter */
    mov r5, r8
    br WaitForAudio

